import './App.css';
import React from 'react';
import {nav} from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <nav class="navbar navbar-expand-lg navbar-black bg-blue">
        <div>
          <h1>AirStat - Flight Status Informatics</h1>
        </div>
      </nav>
    </div>
  );
}

export default App;
